import React from "react";
import "./index.css";

const App = () => {
  return (
    <div className="app-container">
      <div className="flex-container">
        <img
          src="./logoseaherbs.png"
          alt="Logo Sea Herbs"
          className="logo"
          style={{ width: "100px", height: "auto" }}
        />
        <div className="search-box">
          <input
            type="text"
            placeholder="Search..."
            className="input"
            style={{
              width: "100%",
              height: "100%",
              border: "1px solid black", // Added border style
              borderRadius: "50px",
              background: "#fff",
              outline: "none",
              padding: "0 60px 0 20px",
              fontSize: "18px",
              opacity: 0,
              transition: "all 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55)",
            }}
          />
          <div className="search-icon">&#128269;</div>
          <div className="cancel-icon">&#10006;</div>
          <div className="search-data">Search Results</div>
        </div>
      </div>
    </div>
  );
};

export default App;
